import { Card } from 'antd'

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.Image[0] }>
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
